export default function PageNotFound() {
  return (
    <div style={{
      fontFamily: "'Times New Roman', Times, serif",
      textIndent: "15 px",
    }}>
      <img src={pageNotFoundGif} alt='' />
      <h1>Page not found.</h1>
    </div>
  )
}
